(5, 'aboutus', '<p style="text-align:justify"><span style="font-size:18px"><span style="font-family:trebuchet ms,helvetica,sans-serif">Hardware Channel is an integrated online channel program that produces quality sales enquiries for your business and helps convert these enquiries into customers. &nbsp;We will go on extra mile to deliver measurable business value. Hardware Channel understand that effective communication is very crucial for the success of any business, so we maintains a comprehensive, thoughtful process to ensure business continuity and ultimate reliability. Hardware Channel know how important your business is, so we provide the very best solution along with superior customer service. At the end-our aim is to earn user&#39;s trust and commitment to a long lasting relationship.</span></span></p>\n'),
(6, 'contactus', '<p>Email : headwayappworld@gmail.com</p>\n'),
(8, 'terms', '<p>These terms and conditions apply between all Users of this Application and Hardware Channel, the owner(s) of this App.&nbsp;Additionally these terms and conditions apply to the use of and (where applicable) purchase of Hardware Channel Services, including but not limited to Membership subscriptions. Please read these terms and conditions carefully, as they affect your legal rights.</p>\n\n<p><strong>1. Acceptance of Terms</strong></p>\n\n<p>1.1 Your agreement to comply with and be bound by these terms and conditions is deemed to occur upon your first use of the Application.&nbsp; By using the App&nbsp;and agreeing to these terms and conditions, you represent and warrant that you are at least 18 years of age. Your access to and use of the Hardware Channel Application&nbsp;or Services is subject (unless expressly stated otherwise) exclusively to these terms and conditions. You will not use the App&nbsp;for any purpose that is unlawful or prohibited by these terms and conditions. By using the App&nbsp;you are fully accepting the terms, conditions and disclaimers contained in these terms and conditions. If you do not agree to be bound by these terms and conditions, you should stop using the App&nbsp;immediately.</p>\n\n<p>1.2 Hardware Channel&nbsp;reserves the right to change these terms and conditions without notice, and Users agree to be bound by such changes. It is the responsibility of Users to check these Terms and Conditions regularly for any changes.</p>\n\n<p>1.3 If you are entering into these terms and conditions on behalf of your employer or acting as an employee, you warrant that you are authorized to enter into legally binding contracts on behalf of your employer. You further warrant that your employer agrees to be bound by these terms and conditions.</p>\n\n<p><strong>2. Definitions and interpretations</strong></p>\n\n<p>2.1 Throughout this terms and conditions, the following words will have the following meanings set against them:</p>\n\n<p>&ldquo;Advertising&rdquo; such individual media advertising campaign or program of advertising that is purchased by the Client from Hardware Channel;</p>\n\n<p>&ldquo;Advertisement&rdquo; including display, classified, inserts, directories, banners, mini-sites&nbsp;and any other announcement designed to publicly promote activities including Campaigns and Programs;</p>\n\n<p>&ldquo;Advertising Agency/Agent&rdquo; - individual or company instructed to act on behalf of the Client as an agent;</p>\n\n<p>&ldquo;Attendee&rdquo; any person attending an Event in person or whom has access to an Online Event;</p>\n\n<p>&ldquo;Advertisements&rdquo;, is a sub brand of Hardware Channel, exclusively set up to run client lead content and marketing programs</p>\n\n<p>&ldquo;Hardware Channel&rdquo; shall mean brand name of Headway Technologies, D/305/3 Galaxy Arcade, Nr. Galaxy Cinema, Naroda, Ahmedabad;</p>\n\n<p>&ldquo;Content&rdquo; any text, graphics, images, audio, video, software, data compilations, page layout, underlying code and software and any other form of information capable of being stored in a computer that appears on or forms part of this Website;</p>\n\n<p>&ldquo;Copy Date&rdquo; Agreed deadline to supply advertising materials by;</p>\n\n<p>&ldquo;Client&rdquo; any individual or company purchasing Advertising from Hardware Channel;</p>\n\n<p>&ldquo;Directories&rdquo; shall mean the Members Directory and Suppliers Directory collectively;</p>\n\n<p>&ldquo;Event&rdquo; any live event hosted not limited to any training, seminar, workshop, conferences, summits and awards;</p>\n\n<p>&ldquo;Member(s)&rdquo; Users who have an active subscription to a Membership Product;</p>\n\n<p>&ldquo;Membership Product(s)&rdquo; Services and Content offered to Members in a subscription package&nbsp; upon registering as a Member depending on the specific Membership tier that they have purchased;</p>\n\n<p>&ldquo;Membership&rdquo; a Members subscription package to a Membership Product;</p>\n\n<p>&ldquo;Partner&rdquo; third parties (who may or may not be Members or Users) whom have licensed Third Party Content to Hardware Channel&nbsp;in the form of Partner Downloads;</p>\n\n<p>&ldquo;Privacy Policy&rdquo; Hardware Channel&#39;s current Privacy Policy as the same may be amended from time to time;</p>\n\n<p>&ldquo;Rate Card&rdquo; our current price list for Advertisements as supplied by Hardware Channel&nbsp;to Advertiser;</p>\n\n<p>&ldquo;Services&rdquo; collectively or individually as appropriate, any product or service provided by Hardware Channel including but not limited to any services listed on the Website, Reports, Advertising, Products, Membership Products and Events;</p>\n\n<p>&ldquo;Start Date&rdquo;&nbsp; agreed date from which the first advertisement will be placed;</p>\n\n<p>&ldquo;Subscriber&rdquo;&nbsp; the&nbsp; individual or company that orders&nbsp;subscription product;</p>\n\n<p>&ldquo;User&rdquo;, &ldquo;Users&rdquo;, &ldquo;you&rdquo; Any and all persons who access the App and services provided by Hardware Channel, including but not limited to Members;</p>\n\n<p>2.2 In these terms and conditions, unless the context requires a different interpretation:</p>\n\n<p>2.2.1. the singular includes the plural and vice versa;</p>\n\n<p>2.2.2. references to sub-clauses, clauses, schedules or appendices are to sub-clauses, clauses, schedules or appendices of these terms and conditions;</p>\n\n<p>2.2.3. a reference to a person includes firms, companies, government entities, trusts and partnerships;</p>\n\n<p>2.2.4. &#39;including&#39; is understood to mean &#39;including without limitation&#39;;</p>\n\n<p>2.2.5. reference to any statutory provision includes any modification or amendment of it;</p>\n\n<p>2.2.6. the headings and sub-headings do not form part of these Terms and Conditions.</p>\n\n<p><strong>3. Intellectual property and acceptable use of Content</strong></p>\n\n<p>3.1 Content is available via Headway Technologies and this App on a free of charge basis and in consideration for a specified payment, as part of a Membership subscription and content included within the various products, articles (for instance &#39;What&#39;s New&#39; and &#39;Advertisements&#39;&nbsp; sections of the App&nbsp;although this list is non-exhaustive.</p>\n\n<p>3.2 All Content included on the App, unless uploaded by Users, Members or Partners or as stated otherwise, is the property of Hardware Channel our affiliates, licensees or other relevant third parties. By continuing to use the App Users acknowledge that such Content is protected by copyright, trademarks, database rights and other intellectual property rights. Nothing on this App shall be construed as granting, by implication, estoppels, or otherwise, any license or right to use any trademark, logo or service mark displayed on the site without the owner&#39;s prior written permission;</p>\n\n<p>3.3 Subject to clause 4 Hardware Channel hereby grants to the User a non-exclusive worldwide license for the duration of the Membership or in the case of a User who is not a Member, until Hardware Channel may choose to revoke such license, to download, store, use, reproduce, transmit, display, copy, and provide access to Content in accordance with the terms of the Membership (where applicable) and at all times only for the User&#39;s own information purposes and for the avoidance of doubt, not for any commercial or business purposes.</p>\n\n<p>3.4 Notwithstanding any other rights or remedies available to it, Hardware Channel shall have the right to terminate any license granted to any User, to terminate any Membership (where applicable) or block a User from the App in the event of any breach by such User of any of the terms and conditions of this license.</p>\n\n<p>Without prejudice to any rights granted herein, Hardware Channel reserves the right to amend, edit or abbreviate or take down any Content at our discretion.</p>\n\n<p>3.5 Notwithstanding the above, were a User is paying for &nbsp;content (by way of example, part of a Membership subscription) such Users acknowledge that their access to such Content is conditional upon payment in accordance with the payment methods set out and no license shall be granted until payment has been received in full for the relevant Content. For the avoidance of doubt, all one off fees payable for advertisements&nbsp;shall be non-refundable, and the period of license granted in such Content may only subsist for the duration of a Users Membership subscription.</p>\n\n<p>3.6 Subject to clause 4 below, Users (whether in their capacity as Members or Users) are able to upload content or postings content at various places on the App include on Member Profiles (&ldquo;User Generated Content&rdquo;) and in doing so Users grant to Hardware Channel a free of charge, worldwide perpetual license in all media in such User Content. For the avoidance of doubt, Members acknowledge and confirm that all information they supply in their Member profile will be viewable by all Users of the App.</p>\n\n<p><strong>4. Prohibited use of the App by Users</strong></p>\n\n<p>4.1 Users are expressly forbidden to download, store, reproduce, transmit, display (including without limitation via an intranet or extranet site), copy, sell publish, distribute, provide access to Content for any purposes other than as set out herein or to sub-license, rent, lease, transfer or assign any rights in Content, to any other person, commercially exploit or use Content for any unlawful purpose.</p>\n\n<p>4.2 With regard the uploading, or posting of User Generated Content, and use of the app&nbsp;more generally, Users may not use the app for any of the following purposes:</p>\n\n<p>4.2.1 in any way which causes, or may cause, damage to the app or interferes with any other person&#39;s use or enjoyment of the app;</p>\n\n<p>4.2.2 in any way which is harmful, unlawful, illegal, abusive, harassing, misleading, inaccurate, threatening or otherwise objectionable or in breach of any applicable law, regulation or governmental order.</p>\n\n<p><strong>5. Availability of the Application and Disclaimers</strong></p>\n\n<p>5.1 The App&nbsp;and Services are provided &quot;as is&quot; and on an &quot;as available&quot; basis. Hardware Channel gives no warranty that the App or Services will be free of defects and/or faults. To the maximum extent permitted by the law, Hardware Channel&nbsp;provides no warranties (expressed or implied) of fitness for a particular purpose, accuracy of information, compatibility and satisfactory quality. Hardware Channel&nbsp;is under no obligation to update information on the Application.</p>\n\n<p>5.2 Whilst Hardware Channel uses reasonable endeavors to ensure that the App&nbsp;is secure and free of errors, viruses and other malware, Hardware Channel&nbsp;give no warranty or guarantee in that regard and all Users take responsibility for their own security, that of their personal details and their smart phones.</p>\n\n<p>5.3 Hardware Channel accepts no liability for any disruption or non-availability of the Application.</p>\n\n<p>5.4 Hardware Channel&nbsp;reserves the right to alter, suspend or discontinue any part (or the whole of) the App including, but not limited to, any products and/or services available. These terms and conditions shall continue to apply to any modified version of the App unless it is expressly stated otherwise.</p>\n\n<p><strong>6. Limitation of Liability</strong></p>\n\n<p>6.1 Nothing in these terms and conditions will: (a) limit or exclude our or your liability for death or personal injury resulting from our or your negligence, as applicable; (b) limit or exclude our or your liability for fraud or fraudulent misrepresentation; or (c) limit or exclude any of our or your liabilities in any way that is not permitted under applicable law.</p>\n\n<p>6.2 We will not be liable to you in respect of any losses arising out of events beyond our reasonable control.</p>\n\n<p>6.3 To the maximum extent permitted by law, Hardware Channel accepts no liability for any of the following:</p>\n\n<p>6.3.1 any business losses, such as loss of profits, income, revenue, anticipated savings, business, contracts, goodwill or commercial opportunities;</p>\n\n<p>6.3.2 loss or corruption of any data, database or software;</p>\n\n<p>6.3.3 any special, indirect or consequential loss or damage.</p>\n\n<p><strong>7. Application Content and Services</strong></p>\n\n<p>7.1 Except as otherwise expressly agreed to by Hardware Channel in writing, information regarding products and Services is subject to change without notice.</p>\n\n<p>7.2 Information about Hardware Channel Products and Services made available on and/or through this app shall not constitute a representation, warranty or other commitment by Hardware Channel with respect to any product or service unless otherwise expressly agreed to by Hardware Channel in writing.</p>\n\n<p>7.3 Without limiting the generality of the foregoing, Hardware Channel hereby disclaims all warranties, expressed or implied, as to the accuracy, suitability for any purpose or completeness therefore.</p>\n\n<p><strong>8. Third Party Content</strong></p>\n\n<p>8.1 This App makes available certain Content that has not been created by Hardware Channel either via hyperlinks which may take Users to websites not controlled or maintained by Hardware Channel, or as hosted via the App.</p>\n\n<p>8.2 Any copying, distribution, reproduction, retransmission, or modification of any of the Third Party Content or any information or materials appearing in such Third Party Content, whether in electronic or hard copy form, is subject to the prior written permission of the author and publisher of such Third Party Content.</p>\n\n<p>8.3 Third Party Content is not the responsibility of Hardware Channel, and Users acknowledge and confirm that Hardware Channel has no control over the opinions, information, legality of products, or accuracy of facts or statements contained in such Third Party Content and furthermore Hardware Channel cannot guarantee and makes no representation or warranty as to the accuracy, veracity, or completeness of any such information provided. Nothing contained within Third Party Content necessarily represents the point of view of Hardware Channel.&nbsp;</p>\n\n<p>8.4 Hardware Channel cannot and does not confirm each User&#39;s identity, whether or not they are a Member. Hardware Channel&nbsp;allows Members to give access to information about themselves to other Members but&nbsp; does not control the information provided by Users or Members.</p>\n\n<p>8.5 In the event that you have a dispute or issue with one or more of the other Users, you agree to unconditionally release Hardware Channel&nbsp;(and our officers, directors, agents, subsidiaries and employees) from any and all claims, demands and damages (actual and consequential) of any kind and nature, known and unknown, suspected and unsuspected, disclosed and undisclosed, arising out of or in any way connected with such disputes.</p>\n\n<p>8.6 Downloading some Third Party Content such as &#39;Catalogue&#39; may involve Hardware Channel sharing personal data collected during registration with the authors of such Third Party Content. Users who wish to download such Third Party Content should refer to our Privacy Policy prior to downloading. Users who do not wish to have their data shared in this manner should not download such Third Party Content.</p>\n\n<p><strong>9. Membership</strong></p>\n\n<p>Subscription to any Membership Product is subject to acceptance of these terms and conditions, Privacy Policy and specifically the following:</p>\n\n<p>9.1&nbsp;Free Membership commences upon registration, and shall continue until Member gives notice pursuant to clause 9.4&nbsp;below.</p>\n\n<p>9.2&nbsp;Any subscriptions to Membership Products are deemed to commence from the date of receipt of User&#39;s completed order and&nbsp;payment.</p>\n\n<p>9.3&nbsp;With the limited exception of Membership, all Membership Product subscriptions last 1&nbsp;month&nbsp;from invoice date or, where immediate payment is required immediately online prior to the activation of membership and access to any Services, upon payment of such fee.&nbsp; As part of the subscription service, Membership will not&nbsp;be automatically renewed for a following month&nbsp;from the relevant end date.</p>\n\n<p>9.4&nbsp;Members may cancel their renewal at any point throughout their annual subscription. Members may also cancel their renewal within 30 days of the Renewal Date, at no cost. To cancel any Membership Product, Members must inform Hardware Channel in writing by emailing headwaytechnologies@yahoo.com or by writing to our office. Any cancellation by Members must be in writing and a full refund will be given only if this is received by Hardware Channel within 14 working days of the date of purchase. No refund shall be given if Members cancel a service part way through a subscription month or year.</p>\n\n<p><strong>10. Products</strong></p>\n\n<p>Users may show their interest in stand alone Products (whether as Members or Users) as the same are available via the App by relevant enquiries.</p>\n\n<p><strong>11. Media Purchasing</strong></p>\n\n<p>All media and advertising placed with Hardware Channel shall be subject to the following:</p>\n\n<p>11.1 All Advertisements are accepted subject to Hardware Channel&#39;s approval of the copy and to the space being available.</p>\n\n<p>11.2 Hardware Channel reserves the right to omit or suspend any Advertising (or part thereof) at any time for if Hardware Channel&nbsp;holds the belief that publication may be unlawful, defamatory, put Hardware Channel into disrepute, in breach of any Ofcom regulations, or Advertising Standards Agency (or like body) regulation or code, put it in breach of contract or infringes the copyright off a third party in which case no claim on the part of any Client for damage or breach of contract shall arise.</p>\n\n<p>11.3 If Hardware Channel considers it necessary to modify the space or alter the date or position of insertion or make any other alteration, the Client will have the right to cancel if the alterations requested are unacceptable, unless such changes are due to an emergency or circumstances beyond Hardware Channel&#39;s control. Every care is taken to avoid mistakes but Hardware Channel cannot accept liability for any errors due to third parties, subcontractors or inaccurate copy instructions. In any event the Client acknowledges and confirms that its sole remedy for such inaccuracies in Advertisements will be for Hardware Channel to use its reasonable endeavors to remedy such inaccuracies upon notice from the Client , where practicable. For the avoidance of doubt the Client accepts that Advertisements which have gone to print cannot be altered.</p>\n\n<p>11.4 The Client warrants that the Advertisement does not contravene any Act of Parliament nor is it in any other way illegal or defamatory or an infringement of any other party&#39;s rights or an infringement of the British code of Advertising Practice. Country of origin (other than India) of goods advertised must be shown in advertisements if so required by statute or statutory or other regulations.</p>\n\n<p>11.5 The Client will indemnify Hardware Channel fully in respect of any claim made against&nbsp;Hardware Channel&nbsp;arising from&nbsp;Hardware Channel&#39;s publication of any&nbsp; Advertisement or part thereof arising from a breach of any term, condition, undertaking or warranty given hereunder or otherwise to&nbsp;Hardware Channel.&nbsp;Hardware Channel&nbsp;may consult with the Advertiser as to the way in which such claims are to be handled, and may require the Client to enter as a party to any claim.</p>\n\n<p>11.6 Advertisement rates are subject to revision at any time and orders are accepted on condition that, in the case of Advertising placed within an issue of the Magazine, that the price binds Hardware Channel only in respect of the next issue to go to press. In the event of a rate increase, the Client will have the option to cancel the order without surcharge or continue the order at the revised advertisement rates.</p>\n\n<p>11.7 If a Client cancels the balance of a contract for the placement of Advertising, the Client&nbsp; relinquishes any right to any series discount to which they may previously have been entitled and Advertising&nbsp; will be paid for at the then current rate card.</p>\n\n<p>11.8 Accounts are due for settlement within 30 days of the commencement of publication of the Advertising. In the event of any account becoming overdue, Hardware Channel reserves the right both to suspend Advertising until such time as the sum owing is paid and to reduce any commission otherwise allowed to Advertising Agencies.</p>\n\n<p>11.9 Advertisement copy should be supplied by the Client in accordance with the mechanical data stated&nbsp; on the rate card. Charges will be made to the Client or his Agent where the printers are involved in extra production work owing to acts or defaults of the Client or his Agent. These charges will be at the rate agreed prior to commencement of Advertising.</p>\n\n<p>11.10 If copy instructions are not received by agreed Copy Date no guarantee can be given that proofs will be supplied nor corrections made and Hardware Channel reserves the right to repeat the most appropriate copy, or insert a house advertisement for which the Client will be invoiced.</p>\n\n<p>11.11&nbsp;In the case of the Client failure to make complete payment within 30 Days of the invoice date occurred, cumulative monthly interest, at a rate of 10% per month from the invoice date, will be added to the gross amount. If at any time legal fees and costs are incurred as a result in obtaining payment from the Client, those costs will be charged back to the Client.</p>\n\n<p>11.12&nbsp;Client&#39;s materials which may be delivered to Hardware Channel including but not limited to&nbsp; property and artwork are held by Hardware Channel at Client&#39;s risk and should be insured by them against loss or damage from whatever cause. Hardware Channel reserves the right to destroy all artwork, which has been in his custody for twelve months from the date of its last appearance.</p>\n\n<p><strong>12.&nbsp;Pricing</strong></p>\n\n<p>Prices for any of&nbsp;Hardware Channel&nbsp;services&nbsp;are subject to change without prior notice.&nbsp;Hardware Channel&nbsp;aim to regularly update all publicly available sources of price information via the e-mail to ensure that you have accurate information available to you when you order.</p>\n\n<p>The description and price of any Service purchased hereunder will be confirmed in&nbsp;Hardware Channel&#39;s dispatch note and/or invoice or at point of payment if purchased online.</p>\n\n<p><strong>13.&nbsp;Payment Policy</strong></p>\n\n<p>Unless specified herein or at point of purchase to the contrary,&nbsp;Hardware Channel&nbsp;invoices for any Service are due for payment 30 days from their date.&nbsp;Hardware Channel&nbsp;reserve the right to charge for costs and expenses incurred in recovering late payments, and to charge interest on overdue amounts at the rate in force pursuant to the Late Payment of Commercial Debts (Interest) Act 1998 as at the due date.</p>\n\n<p><strong>14.&nbsp;General</strong></p>\n\n<p>14.1 Dependence on&nbsp;Hardware Channel&nbsp;Services: The contents of any of&nbsp;Hardware Channel&nbsp;Services or the App do not constitute advice and should not be relied on in taking, or refraining from taking, any decision or action. Under no circumstances shall&nbsp;Hardware Channel&nbsp;be liable for direct, indirect, or incidental damages resulting from your use of information, commentary, advice or other content on the App. You agree to indemnify&nbsp;Hardware Channel&nbsp;against any actions, claims, proceedings, or liabilities arising from your use of the App.</p>\n\n<p>14.2&nbsp;Force Majeure: If by reason of labour dispute, strikes, inability to obtain labour or materials, fire or other action of the elements, accidents, power or telecommunications failure, customs delays, governmental restrictions or appropriation or other causes beyond the control of a party, such&nbsp;Hardware Channel&nbsp;is unable to perform in whole or in part its obligations set forth in these terms, then&nbsp;Hardware Channel&nbsp;shall be relieved of those obligations to the extent it is thereby unable to perform, and such inability to perform shall not make&nbsp;Hardware Channel&nbsp;liable to any other party.</p>\n\n<p>14.3&nbsp;Users may not transfer any of their rights under these terms and conditions to any other person.&nbsp;Hardware Channel&nbsp;may transfer their rights under these terms and conditions where&nbsp;Hardware Channel&nbsp;reasonably believes Users rights will not be affected.</p>\n\n<p>14.4&nbsp;These terms and conditions may be varied by&nbsp;Hardware Channel&nbsp;from time to time. Such revised terms will apply from the date of publication. Users should check the terms and conditions regularly to ensure familiarity with the then current version.</p>\n\n<p>14.5&nbsp;These terms and conditions contain the whole agreement between the parties relating to its subject matter and supersede all prior discussions, arrangements or agreements that might have taken place in relation to the terms and conditions.</p>\n\n<p>14.6&nbsp;The Contracts (Rights of Third Parties) Act 1999 shall not apply to these terms and conditions and no third party will have any right to enforce or rely on any provision of these terms and conditions.</p>\n\n<p>14.7&nbsp;If any court or competent authority finds that any provision of these terms and conditions (or part of any provision) is invalid, illegal or unenforceable, that provision or part-provision will, to the extent required, be deemed to be deleted, and the validity and enforceability of the other provisions of these terms and conditions will not be affected.</p>\n\n<p>14.8&nbsp;Unless otherwise agreed, no delay, act or omission by a party in exercising any right or remedy will be deemed a waiver of that, or any other, right or remedy.</p>\n\n<p>14.9&nbsp;These terms and conditions shall be construed in accordance with the laws of India and shall be subject to the Ahmedabad jurisdiction only.</p>\n');
