(17, 9, 68, 241, 8, 5, '925005', 'Adjustable window stoper', '1477197005-Kl0kAEB1.jpg', 'Available many type of Stoper like L-tower bolt baby latch door chain regular tower bolt availabl in 10mm N 12mm bar.', '0', 0, '2016-10-23', 'Enable'),
(18, 14, 121, 274, 9, 7, '608107', 'Vittoria Cabinet Handles', '1478596423-k0Rp6q8D.jpg', 'Vittoria is a dynamic and energetic company in the field of Architectural Hardware Fittings, lead by a committed management it is established with a vision of setting new standards of designing, quality and service for the customer in the market. Creativity in design is as on-going process at Vittoria designs. ', '', 0, '2016-11-08', 'Enable'),
