(26, 12, 97, -1, 10, 9, '245651', 'Quba - Night Latches', '1478599976-aQYs8tOx.jpg', 'QUBA''s Night latches are perfect if you need a door lock that can secure the door straight away when closed.  Our selection of night latches contains various body and cylinder finishes and sizes.', '', 0, '2016-11-08', 'Enable'),
(27, 1, 3, 14, 10, 9, '740536', 'Quba - Patch Fittings', '1478600911-TnpXGCVR.jpg', 'With its broad spectrum of basic types and variants, the QUBA Universal range of patch fittings enables the creation of toughened glass constructions of almost any conceivable design. Toughened glass assemblies can be constructed with fixed part components in widely differing arrangements to suit double or single action doors in single leaf or double leaf designs.', '', 0, '2016-11-08', 'Enable'),
(28, 12, 167, -1, 10, 9, '154512', 'Quba - Main Door Set', '1478601092-VaLgbfiX.jpg', 'Precision, dependability and visual elegance. These are the hallmarks of intelligent lock systems from QUBA. Satisfying the highest security standards and offering straightforward, convenient operation, they are suitable for both private and public buildings.', '', 0, '2016-11-08', 'Enable'),
(29, 12, 103, -1, 10, 9, '364303', 'Quba - Mortise Locks', '1478601385-EUxrFoDl.jpg', 'QUBA Project and Contract locks offer the very highest standard of quality and functional reliability.  Locks from QUBA are also offered as a set containing the mortice lock, strike plate and screws.', '', 0, '2016-11-08', 'Enable'),
(30, 12, 96, -1, 10, 9, '645178', 'Quba - Europrofile Cylinders', '1478601697-EdAJTlca.jpg', 'Ensuring your buildings are secure for the protection of your assets and intellectual property is business critical. Whether a simple stand-alone security door to networked control systems, QUBA offers a variety of cutting edge access solutions to suit all needs.', '', 0, '2016-11-08', 'Enable'),
(31, 14, 121, 274, 11, 10, '403572', 'TAB Cabinet Handles', '1478604206-xu4NyjFE.JPG', 'Cabinet Handles from TAB Door Furniture epitomise the high quality expected of the TAB brand, designed for excellence down to the very last detail and exuding fine craftsmanship. They offer genuine quality characterised by clearly defined, identical features irrespective of shape, size or customised manufacturing.', '', 0, '2016-11-08', 'Enable'),
(32, 14, 131, -1, 11, 10, '173735', 'TAB Knobs', '1478604530-8ZLlmCRd.jpg', 'TABs range of Knobs is characterized by outstanding design and superior function.', '', 0, '2016-11-08', 'Enable'),
(33, 14, 123, 284, 11, 10, '201595', 'TAB Mortise Handles', '1478605064-fDZQcVCs.jpg', 'TAB''s Mortise Handles range comes in an attractive design of functional quality. Fittings are characterised by their proven technology and operational reliability.The fittings are manufactured from high quality materials and exude careful workmanship. TAB meets high demands with respect to resilience, reliability.', '', 0, '2016-11-08', 'Enable'),
(34, 14, 128, 302, 11, 10, '754187', 'TAB  Glass Door Handles', '1478605234-yKSFdH2O.JPG', 'TABs range of glass door handles is characterized by outstanding design and sophisticated aesthetics. The modular system means that you can select the best TAB glass door handles to suit your needs.', '', 0, '2016-11-08', 'Enable'),
(35, 14, 122, 279, 11, 10, '821769', 'TAB Pull Handles', '1478605633-ViwpmB60.png', 'TAB pull handles come in a high grade finish with an even, satinised texture, virtually free of contact points throughout the handle section, with irregularities banished and with no shadowing. Needless to say, this also applies to the less accessible locations such as the radii in the curves, the rectangular mitered joints or the transitions from the handle to its supports. Always apparent is the high quality of workmanship and a special regard for fine detail.', '', 0, '2016-11-08', 'Enable'),
(36, 16, 145, -1, 12, 11, '918722', 'Barry Curtain Brackets', '1478606626-09IhiHal.jpg', 'The striking shape of Barry Curtain Brackets is complemented by various attractive collections of architectural finishes and colours to perfectly adapt the curtain brackets to the colour scheme of your build.', '', 0, '2016-11-08', 'Enable'),
(37, 16, 146, -1, 12, 11, '460231', 'Barry Supports', '1478607137-Ktuv17HS.jpg', 'There are many solid arguments calling for heavy duty simplicity and a classic design to meet the durability requirements of everyday usage. Hence the development of the Barry Supports range of reliable, straightforward hardware for project builds.\n ', '', 0, '2016-11-08', 'Enable'),
(38, 16, 147, -1, 12, 11, '696658', 'Barry Tiebacks', '1478607718-z6mDo87p.jpg', 'A perfect combination of form and function  &  The perfect project solution for all application needs.', '', 0, '2016-11-08', 'Enable'),
(39, 10, 72, -1, 12, 11, '362849', 'Barry Robe Hooks', '1478607887-IZB9ySw0.jpg', 'CRAFT and INNOVATION are the ENCOURAGEMENTS !!!!!!', '', 0, '2016-11-08', 'Enable'),
(40, 16, 150, -1, 12, 11, '462161', 'Barry Curtain Rings', '1478608041-p53YFRfV.jpg', 'EXPECT the EXTRAORDINARY...', '', 0, '2016-11-08', 'Enable'),
(41, 16, 149, -1, 12, 11, '940838', 'Barry  Concealed', '1478608171-gujJBAGZ.jpg', 'REFLECTING vibrant individuality EXPRESSING colorful sensuality..!!', '', 0, '2016-11-08', 'Enable'),
(42, 16, 148, -1, 12, 11, '195776', 'Barry End Caps', '1478608290-gbIiqTEX.jpg', 'BARRY -  to EXPLORE DIFFERENT aesthetic choices.', '', 0, '2016-11-08', 'Enable'),
(43, 10, 69, -1, 13, 12, '537444', 'Silverline - PYRAMID Bathroom Set', '1478613225-kpmMh3rY.jpg', 'PYRAMID range is a luxury range of accessories, built to an exacting standard and fit for not just the hotel sector as the name suggests, but also the domestic setting that opts for high standards and a modern definition of luxury. Crafted from brass and finished with a high quality chrome polish exterior, this pieces is ideally suited for inclusion within the contemporary, fashionable bathroom, WC or en suite space.', '', 0, '2016-11-08', 'Enable'),
