(1, 'Admin', 'Admin', 'admin', 'headwaytechnologies@yahoo.com', 'admin', 'user', '', '', 'Rajkot', 'Gujarat', 'India', 0, '', '', '1990-04-10', '0000-00-00', '0000-00-00 00:00:00', '8877524687', '', 'Active', ''),
(7, 'Manufacture', 'Manufacturer', 'jappy7778', 'sales@tunesinterior.com', 'Alpesh Kumar', 'Parikh', 'Jay Shree Krushna Trading Co.', '408, Manjusar G.I.D.C, Near Bombardier Circle, Manjusar, Savli Dist. Savli. 391775', 'Vadodara', 'Gujarat', 'India', 0, '1476613791-WZyRdSgq.jpg', '', '0000-00-00', '2016-10-16', '2016-10-16 16:46:00', '8758099444', '<p><span style="font-size:14px"><span style="font-family:tahoma,geneva,sans-serif"><span style="color:rgb(88, 88, 90)">Here are the offerings that are tough to handle! Yes, encouraged with heart-warming response to 2013 our collection, we have moved a step further and developed entirely new and vibrant collections of knobs and handles. The pages ahead will help you dive into a world of exclusive creativity, encapsulated in uber luxurious shapes, finishes and materials.&nbsp;</span></span>Envisaged by creative minds and crafted by experienced and skilled craftsmen, each of the collections offers you ample choices of knobs and handles to suite your decor. While designing these masterpieces, we have two aspects in the focus, unmatched functionality and brilliant style. As you will see, we have paid full attention to the ergonomics for each of the handles, to ensure they serve the very purpose they are made for. With that, they are able to easily match the interior requirements and create a comprehensive feel of elegance.Playing with different types of materials and textures for mesmerizing designs, we have achieved a fine balance between time-tested insights and advanced cutting edge technology.</span></p>\n\n<p>&nbsp;</p>\n', 'Active', 'Approve'),
(8, 'Manufacture', 'Manufacturer', 'shreeji@12345', 'shreeji@shreejihardware.com', 'Pratik', 'Chavda', 'Shreeji Metal Tech.', 'Shivam Industries Area, Plot No.15,B/h Labh Petroleum Near Meera Udhyog, N/H 8B, Aji Ring Road. 360002', 'Rajkot', 'Gujarat', 'India', 0, '1477140871-HMQoPFVk.jpg', '', '0000-00-00', '2016-10-22', '2016-10-24 10:46:40', '9913856565', 'The products from the technical as well as safety points of view and we, under the brand name of #Shreeji And #SAGA always give weight to technical and safety aspect of our products as well as to their aesthetics value.\nWith the new technology and research and development approach we are using standard raw material of zinc, Nikal plate , Aditive Brighter, original gold plating and Foriatic Lecker.\nISO 9001-2008, CE rated company. This fact inspire us to maintain the best quality of our products and smooth style of our management multistage inspection of components and assemble product at every process guarantee product quality. Thus advancement in technology is what sets Shreeji apart.', 'Active', 'Approve'),
(9, 'Manufacture', 'Manufacturer', '0123456789', 'sales@vittoriadesigns.com', 'Somesh ', 'Malik', 'Vittoria Designs Pvt. Ltd.', 'SURVEY NO. 35/5/1, RAJKOT-GONDAL HIGHWAY-27, NEAR TOLL PLAZA, AT. PIPALIYA, TAL. GONDAL', 'Rajkot', 'Gujarat', 'India', 0, '1478595063-cgGYKEB9.JPG', '', '0000-00-00', '2016-11-08', '2016-11-30 13:02:17', '7623011011', '<p><span style="color:rgb(39, 39, 39); font-family:open sans,sans-serif; font-size:14px">Vittoria designs is a dynamic and energetic company in the ?eld of Architectural Hardware Fittings, lead by a committed management it is established with a vision of setting new standards of designing, quality and service for the customers in the market. Creativity in design is an on-going process at vittoria designs, We have an in-house team of creative product designers who are continuously working towards developing innovative designs that will set new trends in the market. The manufacturing plant is well equipped with the latest technology machines and a technically quali?ed team to meet the increasing needs of the customers. The journey has just begun with a wide range of cabinet handles and shall be followed by many other innovative products in the near future. Willingness to provide designs and quality that surpasses customer&rsquo;s expectations is what sets us apart from the competition.</span></p>\n', 'Active', 'Approve'),
(10, 'Manufacture', 'Manufacturer', '0123456789', 'info@qubaindia.com', 'Somesh', 'Malik', 'Quba Architectural Products Private Limited', 'Plot No. 29-30, Survey No. 33, Near Tulip Party Plot, NH-8, Gondal Road, Vavdi, ', 'Rajkot', 'Gujarat', 'India', 0, '1478598996-JyLnqdob.png', '', '0000-00-00', '2016-11-08', '2016-11-30 13:02:23', '9876543210', 'Quba has created its repute in the market by its aesthetic and effective architectural hardware products. The wide range of Premium series, Eco series, Stainless Steel Handles, Mortise &amp; Cylindrical Locks, Euro profile cylinders and Hinges of Quba are not only statement of style by its look but they are benchmarks of quality as well.The precision in manufacturing the products and the passion to make living better and easy make us the concerned manufacturer. The professional marketing and distribution channel of Quba enables the company to keep the quality standards maintained in every regards.\n', 'Active', 'Approve'),
(11, 'Manufacture', 'Manufacturer', '0123456789', 'info@tabinterior.com', 'Tulesh ', 'Patel', 'TAB Interior Product Pvt. Ltd.', 'Plot No. 7, Survey No. 46/1,  Vavdi Ind. Area,  B/h. Landmark Honda,  Nr. Samrat Hydraulics, Vavadi', 'Rajkot', 'Gujarat', 'India', 0, '1478603800-rfpu0dOw.jpg', '', '0000-00-00', '2016-11-08', '2016-12-10 16:19:18', '9979988886', '<p><span style="font-size:14px"><span style="font-family:arial,helvetica,sans-serif">The client centric approach and the passion for excellence make the TAB&nbsp;team and the TAB&nbsp;products stand apart! Quality basic materiel is something that let us transform them into quality products by the constant supervision of experienced quality controllers, adherence with international quality standards.</span><br />\n<span style="font-family:arial,helvetica,sans-serif">Proliferation in the sphere of technology is nicely caught up by the team TAB. The reason behind the innovations and technology upgradation is the close eye on the changing and shaping science and market scenario. The presence of the classy, handy and smart interior products of TAB&nbsp;are the essence of the integrity of its team.</span></span></p>\n', 'Active', 'Approve'),
(12, 'Manufacture', 'Manufacturer', '0123456789', 'barrycreations@gmail.com', 'Meet ', 'Patel', 'Barry Creation', 'Rasul Para, Opp. Old Toll Tax,  NH-8B,', 'Rajkot', 'Gujarat', 'India', 0, '1478606208-2HZJs3j9.jpg', '', '0000-00-00', '2016-11-08', '0000-00-00 00:00:00', '9898999808', '<p><span style="font-size:14px"><span style="font-family:arial,helvetica,sans-serif">Barry Creations is an endeavour of a group of farsighted entrepreneurs. Backed with sound knowledge and rich experience of the architectural hardware industry, we have established Barry Creations to set new standards of quality in the industry.&nbsp;</span><span style="font-family:arial,helvetica,sans-serif">Established in the year 2011, we have chalked out longs term plans and goals for the company. Currently we are focusing on the segments of curtain brackets, curtain support and tiebacks as well as related accessories. With a penchant for precision and an eye for aesthetics, we have already set the market ablaze with our offerings.Barry Creations began with a corporate culture that is committed to innovation, creativity, trust and respect for all. A culture that encourages both individual and professional growth. A culture that is guided by five core values.</span></span><br />\n&nbsp;</p>\n\n<p><br />\n&nbsp;</p>\n', 'Inactive', 'new_signup'),
(13, 'Manufacture', 'Manufacturer', '0123456789', 'silverline_brass@yahoo.com', 'Bakul', 'Patel', 'Silverline Brass Industries', 'Plot No. 2604/2, Road No. 11, Kranti Gate, Ta. Lodhika, Metoda G.I.D.C,', 'Rajkot', 'Gujarat', 'India', 0, '1478612700-eO5NVybA.jpg', '', '0000-00-00', '2016-11-08', '2016-11-08 19:52:40', '9377481365', '', 'Active', 'Approve'),
(14, 'Manufacture', 'Manufacturer', 'patelchintan', 'ajantabrass@yahoo.in', 'Chintan', 'Patel', 'Ajanta Brass Products ', 'GIDC,shanker tekri udhyognagar,near central bank,shed no.A/43', 'Jamnagar', 'Gujarat', 'India', 0, '1482485588-MVX1QOsk.jpg', '', '0000-00-00', '2016-12-23', '0000-00-00 00:00:00', '9601665725', 'We strongly believe in quality. Quality is based on each and every aspect of our business. ', 'Inactive', 'new_signup'),
(15, 'Manufacture', 'Manufacturer', 'viral7727', 'ganeshmetalproducts@gmail.com', 'Viral', 'Lahoti', 'Ganesh Metal Products', 'Plot No. 456/3, GIDC, Shankar Tekri, Udyognagar, Jamnagar', 'Jamnagar', 'Gujarat', 'India', 0, '1482486436-crThjLAD.jpg', '', '0000-00-00', '2016-12-23', '2016-12-24 14:28:45', '7698777727', 'Our company has registered brand, VIRAL. With more than a decade''s experience in this business domain, we are able to understand exact needs of customers. Keeping their all requirements and industry standards in mind, we design and develop an unmatched collection of brass products. Every piece is precision designed under the right supervision of highly qualified and experienced professionals. We have membership of Jamnagar Hardware Association and Jamnagar Owner''s Factory Association.', 'Active', 'Approve'),
